import React from "react";
import { Route, Routes } from "react-router-dom";
import CategoryHome from "./components/categories/CategoryHome";

function App() {
  return (
    <React.Fragment>
      <Routes>
        <Route path="/" element={<CategoryHome />}></Route>
      </Routes>
    </React.Fragment>
  );
}

export default App;
